lemma LemmaPow2MaskDiv2Auto()
ensures forall e: nat {:trigger Pow2(e)} :: 0 < e ==>
(Pow2(e) - 1) / 2 == Pow2(e - 1) - 1
{
reveal Pow2();
forall e: nat {:trigger Pow2(e)} | 0 < e
LemmaPow2MaskDiv2(e);
}

